var data = '';

var removedCounts = {};

var alphabet = 'abcdefghijklmnopqrstuvwxyz'.split('');

function react(str) {
  var removed = true;

  while (removed) {
    removed = false;
    for (var ndx = 0; ndx < str.length - 1; ndx++) {
      var char = str[ndx];
      var char2 = str[ndx+1];
      if (char !== char2 && char.toLowerCase() == char2.toLowerCase()) {
        str = str.substring(0, ndx) + str.substring(ndx + 2, str.length);
        removed = true;
      }
    }
  }


  return str.length;
}

for (var ndx in alphabet) {
var copy = data;

  var letter = alphabet[ndx];

  copy = copy.replaceAll(letter.toLowerCase(), '').replaceAll(letter.toUpperCase(), '');

  count = react(copy);

  removedCounts[letter] = count;
}

